async function testDecodeEvmTransaction(): Promise<void> {
  console.log(
    " Testing decodeEvmTransaction with real transaction data...\n"
  );

  try {
    // Initialize the decoder
    const decoder = new TxDecoder({
      jsonRpcUrl: "https://jsonrpc-yominet-1.anvil.asia-southeast.initia.xyz",
      registryUrl: "https://registry.initia.xyz",
      restUrl: "https://archival-rest-yominet-1.anvil.asia-southeast.initia.xyz"
    });

    // Decode using EVM transaction decoder (excludes initia.move and opinit)
    const evmDecodedTx = await decoder.decodeEvmTransaction(realTxResponse);

    console.log("\n EVM Decoding Results:");
    console.log(`- Processed Messages: ${evmDecodedTx.messages.length}`);

    evmDecodedTx.messages.forEach((processedMsg, i) => {
      const { balanceChanges, decodedMessage } = processedMsg;
      console.log(`\n  Message ${i + 1}:`);
      console.log(`  - Action: ${decodedMessage.action}`);

      if (decodedMessage.action !== "not_supported") {
        console.log(`  - Data:`, JSON.stringify(decodedMessage.data, null, 4));
      } else {
        console.log(`  - Note: Message type not supported by EVM decoder`);
      }

      // Show balance changes if any
      const hasFtChanges = Object.keys(balanceChanges.ft).length > 0;
      const hasNftChanges =
        balanceChanges.vm === "evm" &&
        Object.keys(balanceChanges.nft).length > 0;

      if (hasFtChanges || hasNftChanges) {
        console.log(`  - Balance Changes:`);
        if (hasFtChanges) {
          console.log(`    FT:`, JSON.stringify(balanceChanges.ft, null, 6));
        }
        if (hasNftChanges) {
          console.log(`    NFTs:`, JSON.stringify(balanceChanges.nft, null, 6));
        }
      }
    });

    // Show metadata
    if (Object.keys(evmDecodedTx.metadata).length > 0) {
      console.log("\n Metadata:");
      console.log(JSON.stringify(evmDecodedTx.metadata, null, 2));
    }

    // Show total balance changes
    const totalFt = Object.keys(evmDecodedTx.totalBalanceChanges.ft).length;
    const totalNfts =
      evmDecodedTx.totalBalanceChanges.vm === "evm"
        ? Object.keys(evmDecodedTx.totalBalanceChanges.nft).length
        : 0;

    if (totalFt > 0 || totalNfts > 0) {
      console.log("\n Total Balance Changes Summary:");
      console.log(`- FT Changes: ${totalFt} addresses affected`);
      console.log(`- NFT Changes: ${totalNfts} addresses affected`);
    }

    console.log("\n EVM transaction decoding completed successfully!");

    const evmSupportedCount = evmDecodedTx.messages.filter(
      (m) => m.decodedMessage.action !== "not_supported"
    ).length;

    console.log(
      `- EVM decoder supported: ${evmSupportedCount}/${evmDecodedTx.messages.length} messages`
    );
  } catch (error) {
    console.error(" Error during EVM transaction decoding:");
    console.error(error);
    process.exit(1);
  }
}

testDecodeEvmTransaction();
